"""<div class="alert alert-block alert-success">
    
## 2.5. Generate the unigram and bigram lists and output as vocab txt <a class="anchor" name="vocab"></a>

Let us take a look at the below code and further understand the flow of things and the methodology used.
Bascially, this code is designed to preprocess a collection of text reviews after which it builds a vocabulary of unigrams and bigrams.Below is the methodology-

- Loading and filtering data : Loading the stopwords filepath and filtering of businesses with atleast 70 text reviews.

- Text preprocessing : This step tokenizes or splits words into tokens, removes the stopwords, stems the words by reducing to root form and then generates bigrams.

- Vocabulary Building : Here, the built_vocabulary function constructs a vocabulary of unique unigrams and bigrams by mapping tokens to their unique indices.

Finally all are saved in the saved_vocabulary function formatted as token:index.
"""

# Preprocess the text: tokenization, removal of stopwords, stemming, and bigram generation
def preprocessing_text(text, stopwords_set, stemmer):
    """
    Preprocess the input text by tokenizing, removing stopwords, applying stemming,
    and generating bigrams.

    Args:
        text (str): The input review text.
        stopwords_set (set): A set of stopwords to be removed.
        stemmer (PorterStemmer): The stemmer to be applied to the tokens.

    Returns:
        list: A list of tokens including both unigrams and bigrams.
    """
    tokens = word_tokenize(text)
    tokens = [token for token in tokens if token.isalnum()]  # Keep only alphanumeric tokens
    tokens = [token for token in tokens if token not in stopwords_set]  # Remove stopwords
    tokens = [stemmer.stem(token) for token in tokens]  # Apply stemming

    # Generate bigrams
    bigrams = ["_".join(bigram) for bigram in zip(tokens, tokens[1:])]

    # Return both unigrams and bigrams
    return tokens + bigrams

# Build the vocabulary
def built_vocabulary(filtered_data, stopwords_set):
    """
    Build a vocabulary of unigrams and bigrams from the filtered review data.

    Args:
        filtered_data (dict): A dictionary of filtered review data.
        stopwords_set (set): A set of stopwords to be removed during preprocessing.

    Returns:
        dict: A vocabulary dictionary mapping each token (unigram or bigram) to a unique index.
    """
    stemmer = PorterStemmer()
    vocab = defaultdict(int)

    for gmap_id, reviews in filtered_data.items():
        for review in reviews:
            tokens = preprocessing_text(review['review_text'], stopwords_set, stemmer)
            for token in tokens:
                if token not in vocab:
                    vocab[token] = len(vocab)  # Index starting from 0

    return vocab

# Save the vocabulary to a file
def saved_vocabulary(vocab, vocab_file_path):
    """
    Save the vocabulary to a file with the format token:index.

    Args:
        vocab (dict): The vocabulary dictionary.
        vocab_file_path (str): The file path where the vocabulary should be saved.

    Returns:
        None
    """
    if len(vocab) == 0:
        print("Warning: Vocabulary is empty. Check your input data and preprocessing steps.")
    else:
        print(f"Vocabulary size: {len(vocab)}")

    with open(vocab_file_path, 'w', encoding='utf-8') as file:
        for token, index in sorted(vocab.items(), key=lambda item: item[1]):
            file.write(f"{token}:{index}\n")

