"""<div class="alert alert-block alert-success">
    
## 2.6. Generate the spare numerical representation and output as countvec.txt <a class="anchor" name="countvec"></a>

Similarly we move on to the countvec file which is designed to generate sparse count vectors for a set of reviews which capture token frequency from the previously mentioned vocabulary for each business. Methodology is as follows-

- We use the same preprocessing functioned defined before.

- built_countvector function constructs a count vector for each business using same above mentioned preprocessing steps.

- Saving the count vector: This basically saves the file to contain the gmap_id followed by the indices and frequencies of tokens for that business.
"""

# Build the count vectors
def built_countvector(filtered_data, stopwords_set, vocab):
    """
    Build the count vectors for each business based on the filtered review data and the given vocabulary.

    Args:
        filtered_data (dict): A dictionary of filtered review data.
        stopwords_set (set): A set of stopwords to be removed during preprocessing.
        vocab (dict): The vocabulary dictionary mapping tokens to their respective indices.

    Returns:
        defaultdict: A dictionary where each key is a business ID (gmap_id) and each value
                     is another dictionary mapping vocabulary indices to their respective frequencies.
    """
    stemmer = PorterStemmer()
    countvec = defaultdict(lambda: defaultdict(int))

    for gmap_id, reviews in filtered_data.items():
        for review in reviews:
            tokens = preprocessing_text(review['review_text'], stopwords_set, stemmer)
            token_counts = Counter(tokens)

            for token, freq in token_counts.items():
                if token in vocab:  # Use only tokens that are in the vocab
                    countvec[gmap_id][vocab[token]] += freq

    return countvec

# Save the count vectors to a file
def saved_countvector(countvec, countvec_file_path):
    """
    Save the count vectors to a file in a sparse format.

    Args:
        countvec (defaultdict): The count vectors dictionary.
        countvec_file_path (str): The file path where the count vectors should be saved.

    Returns:
        None
    """
    with open(countvec_file_path, 'w', encoding='utf-8') as file:
        for gmap_id, token_freqs in countvec.items():
            token_freqs_str = ",".join([f"{index}:{freq}" for index, freq in sorted(token_freqs.items())])
            file.write(f"{gmap_id},{token_freqs_str}\n")

